  lv_style_set_line_color(&second_line, LV_STATE_DEFAULT, LV_COLOR_MAKE(0xed, 0x1c, 0x24));
  lv_style_set_line_rounded(&second_line, LV_STATE_DEFAULT, true);

  bitmap.header.always_zero = 0;
  bitmap.header.w = 240;
  bitmap.header.h = 240;
  bitmap.data_size = 58624;
  bitmap.header.cf = LV_IMG_CF_INDEXED_8BIT;
  bitmap.data = bitmap_map;
  lv_obj_t *img_src = lv_img_create(lv_scr_act(), NULL);
  lv_img_set_src(img_src, &bitmap);
  lv_obj_set_pos(img_src, 0, 0);

  batteryIcon = lv_label_create(lv_scr_act(), nullptr);
